insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">都内最大級(ぼく調べ)<br>の小籠包を目当てに「新亜飯店」へ<br><br>特大6個入りひと籠でも十分だが、2籠食べて罪悪感に浸り東京タワーを見上げるのがおきまりのスタイル<br><br>今日は豆苗の炒めもオーダー<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/5qgXf02e1D">pic.twitter.com/5qgXf02e1D</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/823090479147270144">2017年1月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',823090479147270144);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今夜は友人がオーナーの青葉台「CANVAS 」へ<br><br>元シェイノのシェフ2人がゲストに合わせた調理法、ソースで自由に描くプリフィクスコース<br><br>素敵な内装とカジュアルな雰囲気でプライスも5000円とリーズナブル<br><br>代官山や中目黒散策後の普段使いに<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/fv8Hp9Ddyr">pic.twitter.com/fv8Hp9Ddyr</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/822791914713821185">2017年1月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',822791914713821185);
